$scope.handleOnChange = function() {

                ForceRemoting('searchMembers', {name : $scope.case.Caller__r.Name}).then(function(res) {
                    console.log(res);
                    $scope.callerResults = res;
                });
            };

            $scope.selectItem = function(keyCode, searchingSet) {
                keyCode = keyCode.keyCode;
                switch (keyCode) {
                    case 38:
                        console.log('up');
                        if ($scope.indexVariable &gt; 0) $scope.indexVariable -= 1;
                        break;
                    case 40:
                        console.log('down');
                        if ($scope.indexVariable &lt; searchingSet.length - 1) $scope.indexVariable += 1;
                        break;
                    case 13:
                        console.log('enter');
                    case 27:
                        console.log('esc');
                        $scope.callerResults = [];
                    default:
                        //
                }
                console.log($scope.indexVariable);


            }
